import styled from "styled-components";
function Header() {
    const HeaderContainer = styled.div`
        background : black;
        color   :   white;
        padding :   12px 64px;
        display :   flex;
        flex-direction  :   row;
        justify-content :   space-between;
    `;

    const HeaderSubContainer = styled.div`
        color   :   white;
        padding :   8px;
        display :   flex;
        flex-direction  :   row;
        font-weight : 600;
        align-items :   center;
        gap     :   20px;
    `;

    const SearchBar = styled.div`
        background  :   #1b1b1b;
        color       :   #DDDDDD;
        border-radius : 128px;
        padding     : 16px 32px;
        border      :   1px solid #303030;
        width       : 400px;
        height      : 16px;
    `;

    const PrimaryGlowingButton = styled.div`
        background  :   #1b1b1b;
        color       :   #DDDDDD;
        border-radius : 128px;
        padding     : 16px 32px;
        border      :   1px solid #303030;

    `;

    return (
    <div>
    <HeaderContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
        <HeaderSubContainer>
            <SearchBar></SearchBar>
        </HeaderSubContainer>
        <HeaderSubContainer>
            <PrimaryGlowingButton>Account</PrimaryGlowingButton>
            <PrimaryGlowingButton>
            <svg style={svgIconStyle} xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24"><path d="M10 21H14C14 22.1 13.1 23 12 23S10 22.1 10 21M21 19V20H3V19L5 17V11C5 7.9 7 5.2 10 4.3V4C10 2.9 10.9 2 12 2S14 2.9 14 4V4.3C17 5.2 19 7.9 19 11V17L21 19M17 11C17 8.2 14.8 6 12 6S7 8.2 7 11V18H17V11Z" /></svg>
            </PrimaryGlowingButton>
        </HeaderSubContainer>
    </HeaderContainer>
    </div>
  );
}

export default Header;
